":"https://instagram.fdad1-1.fna.fbcdn.net/vp/690662b1ed5d6ab95350870d76231dde/5BBBD75E/t51.2885-15/s480x480/e35/c0.7.1080.1080/34689830_268164427085194_396100996641587200_n.jpg","config_width":480,"config_height":480},{"src":"https://instagram.fdad1-1.fna.fbcdn.net/vp/e9aed183d6469e2782e791d86465c56b/5BC7D168/t51.2885-15/s640x640/sh0.08/e35/c0.7.1080.1080/34689830_268164427085194_396100996641587200_n.jpg","config_width":640,"config_height":640}],"is_video":false}},{"node":{"__typename":"GraphImage","id":"1805986656681938526","edge_media_to_caption":{"edges":[{"node":{"text":"#Ad Nothing ever stopped me from being me until #morningsickness. You know how sick I was while pregnant; I could barely get out of bed. That was before I found a safe \u0026 effective med to treat my morning sickness when diet \u0026 lifestyle changes didn\u2019t help. I hear there\u2019s a new formulation of the drug combination I took that\u2019s made to work faster \u0026 longer. If you\u2019re pregnant \u0026 feeling sick \u0026 changing your diet \u0026 lifestyle doesn\u2019t work, ask your doctor about Bonjesta\u00ae (doxylamine succinate/pyridoxine HCl). Most common side effect is drowsiness. Bonjesta.com for safety info.\nFor U.S. residents only.\nINDICATION\nBonjesta\u00ae is a prescription medicine to treat nausea \u0026 vomiting of pregnancy in women who haven\u2019t improved with change in diet/other non-medicine treatments. Bonjesta\u00ae hasn\u2019t been studied in children under 18.\nLIMITATIONS OF USE\nIt isn\u2019t known if Bonjesta\u00ae is safe \u0026 effective in women with severe nausea \u0026 vomiting of pregnancy (hyperemesis gravidarum). Women with this condition may need to be hospitalized.\nSELECT SAFETY INFORMATION\nDon\u2019t take Bonjesta\u00ae if you\u2019re allergic to doxylamine succinate, other ethanolamine derivative antihistamines, pyridoxine hydrochloride or any ingredients in Bonjesta\u00ae. See Patient Information leaflet for complete list of ingredients. Don\u2019t take Bonjesta\u00ae in combination with medicines called MAOIs, as these medicines can intensify \u0026 prolong adverse central nervous system (CNS) effects of Bonjesta\u00ae. Ask your healthcare provider/pharmacist if you aren\u2019t sure if you take an MAOI.\nThe most common side effect of Bonjesta\u00ae is drowsiness. Don\u2019t drive, operate heavy machinery or do other activities that need your full attention unless your healthcare provider says you can.\nDon\u2019t drink alcohol, or take other CNS depressants such as cough \u0026 cold medicines, certain pain medicines \u0026 medicines that help you sleep while taking Bonjesta\u00ae. Severe drowsiness can happen or become worse causing falls/accidents. Bonjesta\u00ae may result in false positive urine drug screening for methadone, opiates and PCP.\nDuchesnay USA encourages you to report negative side effects of prescription drugs to the FDA. Visit www.fda.gov/medwatch or call 1-800-FDA-1088"}}]},"shortcode":"BkQJ0u0n05e","edge_media_to_comment":{"count":12026},"comments_disabled":false,"taken_at_timestamp":1529510408,"dimensions":{"height":1348,"width":1080},"display_url":"https://instagram.fdad1-1.fna.fbcdn.net/vp/848f1370237a3f06dcd6e511763ece9f/5BAFB9C4/t51.2885-15/e35/33535421_1903044889716257_388815881704046592_n.jpg","edge_liked_by":{"count":652349},"edge_media_preview_like":{"count":652349},"gating_info":null,"media_preview":"ACEq3KxbkPPMSvIj+UfXuR071tLycVlIvkyOpYNznPuex96TKjuSo5RMvyRWXdusrBl9PWtcAd+lZF1tEmEGPWpRb2K22ilzRWhmdH5gP3ztP4gfnWdPIkdxlj8sgBz6EcD65FXjGCNpHA7dqoXce5+FBwAOSR0+lRfuaW6okaQfwc5/AfrWRK2GOfWttz5aFmHQc1hkG4k+UYB/QUkN6jN1Faf9nL6miqINGInZgnO3jP0poUE5Pehfun8aVu30qOhfUSSFZMbs4HbNKsaJwgAHtT+1IvWmIkopaKsyP//Z","owner":{"id":"18428658"},"thumbnail_src":"https://instagram.fdad1-1.fna.fbcdn.net/vp/4897c07e5b4478740fab274b20a87771/5BCC2877/t51.2885-15/s640x640/sh0.08/e35/c0.127.1021.1021/33535421_1903044889716257_388815881704046592_n.jpg","thumbnail_resources":[{"src":"https://instagra
